/** @jsx jsx */
import React, { useState, RefObject } from "react";
import { CarouselOption } from "./interface";
import { jsx, css, keyframes, InterpolationWithTheme } from "@emotion/core";
import { Keyframes, SerializedStyles } from "@emotion/serialize";
const Carousel = (props: any) => {
  const options: CarouselOption[] = props.options;
  let curIndex = 1;
  let isDragging = false;
  let containerRef: RefObject<HTMLDivElement> = React.createRef();
  let imgRefs: Array<RefObject<HTMLImageElement>> = [];
  let offset = 0;
  for (let index = 0; index < options.length; index++) {
    const imgRef: RefObject<HTMLImageElement> = React.createRef();
    imgRefs.push(imgRef);
  }
  const Bigger = keyframes`
from { transform: scale(0.6) ; }
to   { transform: scale(1) ; }
`;
  const Smaller = keyframes`
from { transform: scale(1) ; }
to   { transform: scale(0.6) ; }
`;
  const goLeft = keyframes`
from { transform: translateX(${(2 - curIndex) * 110}px) ; }
to   { transform: translateX(${(2 - curIndex) * 110 - 110}px) ; }
`;
  const goRight = keyframes`
from { transform: translateX(${-curIndex * 110}px); }
to   { transform: translateX(${-curIndex * 110 + 110}px) ; }
`;
  const getContainerCss = () => {
    return css`
      transform: translateX(${(1 - curIndex) * 110}px);
      transition: transform 2s ease-in-out;
    `;
  };
  const getImageCss = (index: number) => {
    if (index !== curIndex) {
      return css`
        transform: scale(0.6);
        transition: transform 2s ease-in-out;
      `;
    } else {
      return css`
        transform: scale(1);
        transition: transform 2s ease-in-out;
      `;
    }
  };

  const handleMouseDown = (e: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    isDragging = true;
    if (containerRef.current) {
      containerRef.current.style.transition = `none`;
    }
    for (let index = 0; index < imgRefs.length; index++) {
      const imgRef = imgRefs[index];
      if (imgRef.current) {
        imgRef.current.style.transition = `none`;
      }
    }
  };
  const handleMouseMove = (e: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    if (isDragging) {
      offset = offset + e.movementX;
      const translateX = -curIndex * 110 + 110 + offset;
      if (translateX < (options.length - 2) * -110) {
        offset = (options.length - 2) * -110 + curIndex * 110 - 110;
      } else if (translateX > (options.length - 3) * 110) {
        offset = (options.length - 3) * 110 + curIndex * 110 - 110;
      }

      if (containerRef.current) {
        containerRef.current.style.transform = `translateX(${-curIndex * 110 +
          110 +
          offset}px)
  `;
      }

      if (offset < 0) {
        if (-Math.ceil(offset / 110) < options.length - 2) {
          console.log(curIndex - Math.ceil(offset / 110));
          const curImg = imgRefs[curIndex - Math.ceil(offset / 110)].current;
          const nextImg =
            imgRefs[curIndex - Math.ceil(offset / 110) + 1].current;
          if (curImg) {
            curImg.style.transform = `scale(${1 -
              ((-offset % 110) / 110) * 0.4})
    `;
          }
          if (nextImg) {
            nextImg.style.transform = `scale(${0.6 +
              ((-offset % 110) / 110) * 0.4})
    `;
          }
        }
      } else {
      }
    }
  };
  const handleMouseUp = (e: React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    isDragging = false;
    if (containerRef.current) {
      containerRef.current.style.transition = `transform 2s ease-in-out`;
    }
    for (let index = 0; index < imgRefs.length; index++) {
      const imgRef = imgRefs[index];
      if (imgRef.current) {
        imgRef.current.style.transition = `transform 2s ease-in-out`;
      }
    }
  };
  const handleMouseLeave = (
    e: React.MouseEvent<HTMLDivElement, MouseEvent>
  ) => {
    isDragging = false;
    if (containerRef.current) {
      containerRef.current.style.transition = `transform 2s ease-in-out`;
    }
    for (let index = 0; index < imgRefs.length; index++) {
      const imgRef = imgRefs[index];
      if (imgRef.current) {
        imgRef.current.style.transition = `transform 2s ease-in-out`;
      }
    }
  };

  const prev = () => {
    if (curIndex === options.length - 1) return;
    const curImg = imgRefs[curIndex].current;
    const nextImg = imgRefs[curIndex + 1].current;
    if (containerRef.current) {
      containerRef.current.style.transform = `translateX(${-curIndex * 110}px)
`;
    }
    if (curImg)
      curImg.style.transform = `scale(0.6)
`;
    if (nextImg)
      nextImg.style.transform = `scale(1)
`;

    curIndex = curIndex + 1;
  };
  const next = () => {
    if (curIndex === 0) return;
    const curImg = imgRefs[curIndex].current;
    const nextImg = imgRefs[curIndex - 1].current;
    if (containerRef.current) {
      containerRef.current.style.transform = `translateX(${(2 - curIndex) *
        110}px)
`;
    }
    if (curImg)
      curImg.style.transform = `scale(0.6)
`;
    if (nextImg)
      nextImg.style.transform = `scale(1)
`;
    curIndex = curIndex - 1;
  };

  return (
    <div className="carousel">
      <div
        css={getContainerCss()}
        className="imgContainer"
        onMouseDown={handleMouseDown}
        onMouseMove={handleMouseMove}
        onMouseUp={handleMouseUp}
        onMouseLeave={handleMouseLeave}
        onClick={e => {
          e.preventDefault;
        }}
        ref={containerRef}
      >
        {options.map((item, index) => (
          <img
            draggable={false}
            alt={item.name}
            src={item.url}
            key={item.name}
            css={getImageCss(index)}
            ref={imgRefs[index]}
          />
        ))}
      </div>
      <a className="prev" onClick={prev}>
        &#10094;
      </a>
      <a className="next" onClick={next}>
        &#10095;
      </a>
    </div>
  );
};

export default Carousel;
